import Link from 'next/link';
import Button from 'react-bootstrap/Button';
import Navbar from "react-bootstrap/Navbar";
import Container from 'react-bootstrap/Container';
const services_array = ["Prabhakar Mishra", "Solutions", "Projects", "Gear", "Music", "Contact Me"];

const linkStyle = {
  marginRight: 15,
  color : "grey",
}
const Header = () => {
  return (
    <Navbar bg="light" sticky="top" expand="lg">
      {services_array.map(service => (
        <Container>
        <Link href={`/${(service.replace(" Me", '')).replace("Prabhakar Mishra", '')}`}>
          <span variant="outline-dark" style={linkStyle}>{service}</span>
        </Link>
        </Container>
    ))}
  </Navbar>
);
}

export default Header



